// App.js
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './app/component/Home';

import 'bootstrap/dist/css/bootstrap.min.css';
import PointerHome from './app/component/pointer';
import PointerVote from "./app/component/pointer/PointerVote";

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<PointerHome />}></Route>
      <Route path='/session/:token' element={<PointerVote />}></Route>
      <Route path='*' element={<PointerHome />}></Route>



    </Routes>
    </BrowserRouter>
  );
}

export default App;
